import React from "react";
import ReactDom from "react-dom";



const App = () =>
{
  const d = new Date();
  const time = d.getHours();
  let str = "";
  console.log(time);
  if(time >= 7 && time <= 12)
  {
    str = "good morning!";
  }
  else if(time > 12 && time <= 18)
  {
    str = "good afternoon!";
  }
  else
  {
    str = "good night!";
  }



  return (
    <h1>{str}</h1>


  )
}
const Element = <>

  <App/>


</>




const root = ReactDom.createRoot(document.getElementById('root'));
